// This is the Link API
import Link from "next/link";

const Index = () => (
  <div>
    <h1>MAIN PAGE - USE THESE LINKS TO NAVIGATE TO PROTOTYPED PAGES</h1>

    <li>
      <Link href="/careers">
        <a>Careers</a>
      </Link>
    </li>
  </div>
);

export default Index;
